function defCadre(obj) {
	console.log("posY",obj,tableObjet[obj])
	var txt="position:absolute;top:"+tableObjet[obj].posY+"px;left:"+tableObjet[obj].posX+"px;"
	txt=txt+"width:"+tableObjet[obj].bkgWidth+"px;height:"+tableObjet[obj].bkgHeight+"px;"
	var nopac=Math.round(parseFloat(tableObjet[obj].bkgOpacity)*255)
	var color=tableObjet[obj].bkgColor+ (nopac.toString(16))
	if(tableObjet[obj].bkgTrp==true){
		txt=txt+"background-color:transparent;"
	}else{
		txt=txt+"background-color:"+color+";"
	}
	if(tableObjet[obj].bkgImg!=""){
		txt=txt+"background-image:url('"+tableObjet[obj].bkgImg+"');background-size:"+tableObjet[obj].bkgWidth+"px "+tableObjet[obj].bkgHeight+"px;"
	}
	txt=txt+"border-left-color:"+tableObjet[obj].borderGc+";border-left-style:"+tableObjet[obj].borderGs+";border-left-width:"+tableObjet[obj].borderGw+"px;border-top-left-Radius:"+tableObjet[obj].borderGr+";"
	txt=txt+"border-top-color:"+tableObjet[obj].borderHc+";border-top-style:"+tableObjet[obj].borderHs+";border-top-width:"+tableObjet[obj].borderHw+"px;border-top-right-radius:"+tableObjet[obj].borderHr+";"
	txt=txt+"border-right-color:"+tableObjet[obj].borderDc+";border-right-style:"+tableObjet[obj].borderDs+";border-right-width:"+tableObjet[obj].borderDw+"px;border-bottom-right-radius:"+tableObjet[obj].borderDr+";"
	txt=txt+"border-bottom-color:"+tableObjet[obj].borderBc+";border-bottom-style:"+tableObjet[obj].borderBs+";border-bottom-width:"+tableObjet[obj].borderBw+"px;border-bottom-left-radius:"+tableObjet[obj].borderBr+";"
	return txt
}
function graphCircle(objActif){
	var dupnode=document.createElement('div');
	dupnode.setAttribute("id",tableObjet[objActif].id);
	dupnode.setAttribute("title",tableObjet[objActif].nom);
	console.log("cadre",tableObjet[objActif])
	var st=defCadre(objActif)
	dupnode.setAttribute("style",st);
	dupnode.setAttribute("title",tableObjet[objActif].nom);
	var txt="<svg width='"+tableObjet[objActif].bkgWidth+"' height='"+tableObjet[objActif].bkgHeight+"'  xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'>"; 
	txt=txt+"<circle cx='"+(tableObjet[objActif].r+tableObjet[objActif].margeG)+"' cy='"+(tableObjet[objActif].r+tableObjet[objActif].margeH)+"' r='"+(tableObjet[objActif].r-tableObjet[objActif].objBorderW)+"' fill='"+tableObjet[objActif].objColor+"' transform='scale("+tableObjet[objActif].scaleX+","+tableObjet[objActif].scaleY+")' stroke='"+tableObjet[objActif].objBorderC+"' stroke-width='"+tableObjet[objActif].objBorderW+"' /></svg>";
	document.getElementById("space").appendChild(dupnode);
	document.getElementById(tableObjet[objActif].id).innerHTML=txt;
}
