function graphGrp(obj){
	var dupnode=document.createElement('div')
	dupnode.setAttribute("id","grp"+obj)
	dupnode.setAttribute("title","grp"+obj)
	dupnode.setAttribute("class",4)
	var st=defCadre(obj)
	dupnode.setAttribute("style",st);
	document.getElementById("space").appendChild(dupnode)
}
